https://www.glenrocknews.today/2020/06/12/317990/glen-rock-high-school-academic-awards-continue-during-virtual-learning
@GRPSHighSchool

It's time to ROCK! Mark your calendars and grab the popcorn!

@GRMiddleSchool Virtual Talent Show 2020 will premiere on GRTV this Friday & Saturday at 7 PM, and Sunday at 2 PM and re-air every weekend thereafter, through the month of June (Verizon Fios, Channel 32; Cablevision, Channel 77).

For family outside of the Glen Rock viewing area, the show will be accessible online, from the Middle School website, Announcements Page, released and viewable at the same time that it airs on GRTV. Get ready for a great night of entertainment featuring vocals, instrumentals, comedy, a short animated film, dance, and a rock band, performed by your friends and classmates! To see the show program, and access quick links to the show, go to: https://tinyurl.com/y9fee5qd

